import React from 'react';
import {connect} from 'react-redux';
import {Link} from 'react-router-dom';
import {fetchPredictions} from '../../actions';

class PastPredictions extends React.Component {
  componentDidMount(){
    this.props.fetchPredictions();
  }
  render(){
    console.log("PastPredictions is mounted");
    return(
      <div>I am past predictions!</div>
    )
  }
}

export default PastPredictions;
